  /**
   * Gets the next event in file, by reading the next line.
   * @return An MCEvent containing input and output particles.
   */
  public MCEvent getNext() {
    MCEvent ev = new MCEvent();

    if (m_pos >= m_info.length) m_pos = 0;
    String line = m_info[m_pos];
    m_pos++;

    double px;
    double py;
    double pz;
    double e;
    String [] ls = line.split(" +");
    int i = 5;

    px = Double.parseDouble(ls[i]); i++;
    py = Double.parseDouble(ls[i]); i++;
    pz = Double.parseDouble(ls[i]); i++;
    e  = Double.parseDouble(ls[i]); i++;
    ev.set(0, px, py, pz, e);

    px = Double.parseDouble(ls[i]); i++;
    py = Double.parseDouble(ls[i]); i++;
    pz = Double.parseDouble(ls[i]); i++;
    e  = Double.parseDouble(ls[i]); i++;
    ev.set(1, px, py, pz, e);

    px = Double.parseDouble(ls[i]); i++;
    py = Double.parseDouble(ls[i]); i++;
    pz = Double.parseDouble(ls[i]); i++;
    e  = Double.parseDouble(ls[i]); i++;
    ev.set(2, px, py, pz, e);

    px = Double.parseDouble(ls[i]); i++;
    py = Double.parseDouble(ls[i]); i++;
    pz = Double.parseDouble(ls[i]); i++;
    e  = Double.parseDouble(ls[i]); i++;
    ev.set(3, px, py, pz, e);
    return ev;
  }
